import React, { Component } from 'react';


class Footer extends React.Component {
    render() {
        return (
            <div>
                <a href="#" class="fa fa-facebook"></a>&nbsp;&nbsp;
                <a href="#" class="fa fa-instagram"></a>&nbsp;
                <a href="#" class="fa fa-linkedin"></a>&nbsp;
            </div>
        );
    }
}

export default Footer;
